//import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <image src= "Nuance.png" alt="logo" />

        <p>
         <code>Click Here to Delete Resources </code> Click .
        </p>
        <a
          className="App-link"
          href="https://www.nuance.com/index.html"
          target="_blank"
          rel="noopener noreferrer"
        >
        Nuance Website
        </a>
      </header>
    </div>
  );
}

export default App;
